void sub_GAME_7F04DEFC(PropRecord *arg0, f32 arg1, struct coord3d *arg2, s32 arg3, s32 owner)
{
    PropRecord *node;
    ObjectRecord *prop_obj;

    prop_obj = arg0->obj;

    prop_obj->runtime_bitflags &= ~(RUNTIMEBITFLAG_OWNER);
    prop_obj->runtime_bitflags |= (owner << RUNTIMEBITSHIFT_OWNER);

    if ((s32)(prop_obj->runtime_bitflags << 0xc) >= 0)
    {
        node = arg0->child;
        while (node != NULL)
        {
            PropRecord *iter_next = node->prev;
            // recursive call:
            sub_GAME_7F04DEFC(node, arg1, arg2, arg3, owner);
            node = iter_next;
        }

        maybe_detonate_object(arg0->obj, arg1, arg2, arg3, owner);
    }
}





bool check_if_destroyable_object_type(PropDefHeaderRecord *obj)//#MATCH
{
    switch (obj->type)
    {
        case PROPDEF_DOOR:
        case PROPDEF_PROP:
        case PROPDEF_ALARM:
        case PROPDEF_CCTV:
        case PROPDEF_MONITOR:
        case PROPDEF_MULTI_MONITOR:
        case PROPDEF_RACK:
        case PROPDEF_AUTOGUN:
        case PROPDEF_GAS_RELEASING:
        case PROPDEF_VEHICHLE:
        case PROPDEF_AIRCRAFT:
        case PROPDEF_UNK41:
        case PROPDEF_GLASS:
        case PROPDEF_SAFE:
        case PROPDEF_TANK:
        case PROPDEF_TINTED_GLASS:
            return TRUE;
        default:
            return FALSE;
    }
}


bool check_if_collectable_object(PropDefHeaderRecord *obj)//#MATCH
{
    switch (obj->type)
    {
        case PROPDEF_KEY:
        case PROPDEF_MAGAZINE:
        case PROPDEF_COLLECTABLE:
        case PROPDEF_HAT:
        case PROPDEF_AMMO:
        case PROPDEF_ARMOUR:
            return TRUE;
        default:
            return FALSE;
    }
}






