void append_text_ammo_amount_word(u8 *buffer, AMMOTYPE ammotype,u32 amount)
{
    u8 *textfiletext;
    
    switch(ammotype) {
    case AMMO_9MM:
    case AMMO_9MM_2:
    case AMMO_RIFLE:
    case AMMO_PLASTIQUE:
        textfiletext = langGet(TEXT(LPROPOBJ,0x01)); //some
        strcat(buffer,textfiletext);
        break;
    case AMMO_SHOTGUN:
    case AMMO_GRENADE:
    case AMMO_ROCKETS:
    case AMMO_REMOTEMINE:
    case AMMO_PROXMINE:
    case AMMO_TIMEDMINE:
    case AMMO_KNIFE:
    case AMMO_GRENADEROUND:
    case AMMO_MAGNUM:
    case AMMO_GGUN:
    case AMMO_DARTS:
    case AMMO_FLARE:
    case AMMO_PITON:
    case AMMO_DYNAMITE:
    case AMMO_BUG:
    case AMMO_MICRO_CAMERA:
        if (amount == 1) {
            textfiletext = langGet(TEXT(LPROPOBJ,0x02)); //a
            strcat(buffer,textfiletext);
        }
        else {
            textfiletext = langGet(TEXT(LPROPOBJ,0x01)); //some
            strcat(buffer,textfiletext);
        }
        break;
    case AMMO_EXPLOSIVEPEN:
    case AMMO_BOMBCASE:
        if (amount == 1) {
            textfiletext = langGet(TEXT(LPROPOBJ,0x03)); //an
            strcat(buffer,textfiletext);
        }
        else {
            textfiletext = langGet(TEXT(LPROPOBJ,0x01)); //some
            strcat(buffer,textfiletext);
        }
        break;
    case AMMO_GEKEY:
    case AMMO_TOKEN:
        if (amount == 1) {
            textfiletext = langGet(TEXT(LPROPOBJ,0x04)); //the
            strcat(buffer,textfiletext);
        }
        else {
            textfiletext = langGet(TEXT(LPROPOBJ,0x01)); //some
            strcat(buffer,textfiletext);
        }
    }
    return;
}







